import {
  Navbar,
  BigSidebar,
  FlashSales,
} from './components';
import { Hero } from './pages/Dashboard';
import { iphones } from './components/Data';
import Carousel from './components/Carousel';
import Categories from './components/Categories';

function App() {
  return (
    <>
      <Navbar />
      <BigSidebar images={iphones} />
      <Carousel />
      <Categories />
    </>
  );
}

export default App;
